import React from "react" 
import Recharts, { Bar } from "recharts"
import {BarChart ,XAxis ,YAxix,Line,Tooltip,CartesianGrid } from "recharts"

const Chart=(props)=>{
    const {data}=props
    return <BarChart
                width={400}
                height={400}
                data={data}
                margin={{ top: 5, right: 20, left: 10, bottom: 5 }}
            >
                
                
                <CartesianGrid stroke="#f5f5f5" />
                <XAxis dataKey="name" />
                <YAxix/>
                <Tooltip />
                <Bar type="monotone" dataKey="uv" stroke="#ff7300" yAxisId={0} />
                <Bar type="monotone" dataKey="pv" stroke="#387908" yAxisId={1} />
            </BarChart>
}

export default Chart
